import React, {useEffect,useState} from 'react';
import {useParams} from 'react-router-dom'
import axios from 'axios'
import Presentation from './Presentation'
import Footer from './Footer'
import {Container, Row, Col} from 'react-bootstrap'
const DetailVoiture = () => {
    const [data, setmaData] = useState([])
    const {id} = useParams()
    useEffect(() => {
        detailId()
    },[])

    const detailId = async() => {
        const urlGetById = `http://localhost:5000/login/recupereInfoVoiture/${id}`
        await axios.get(urlGetById,{headers:{"token":window.localStorage.token}}).then((res) => {
            console.log(res.data.getVoiture);
            setmaData([res.data.getVoiture])
            //setmaData(res.data.getVoiture)
            console.log(data)
            })
    }
    return (
        <div>
         <Presentation/>
            <h1> DetailVoiture</h1>
           <Container>
                 {data.map((voiture) => {
                return(
                    <div>
                        {/* <h1> {voiture.marque}</h1>
                        <h1> {voiture.marque}</h1>
                        <h1> {voiture.marque}</h1> */}
                        <Row>
                            <Col sm={11}> 
                              <Row>
                                <Col><img src={voiture.image.url} className="imageDetail"/> </Col>
                                <Col>
                                    <h1 style={{marginRight:50}}> {voiture.marque}</h1>
                                    <h1> {voiture.marque}</h1>
                                    <h1> {voiture.marque}</h1>
                                </Col>
                              </Row>
                            </Col>
                        </Row>
                    </div>
                )
            })}
           </Container>
            <Footer/>
        </div>
    );
};

export default DetailVoiture;
